import React from 'react';
import {FaPlus} from 'react-icons/fa';

const AddItem = () => {
    return (
       <form className='addForm'>
        <label htmlFor='add'>Add Item</label>
        <input 
           autoFocus
           id='addItem'
           type='text'
           placeholder='add Item' 
           required
        />




        <button type='submit'
         aria-label='Add Item'
        >
        <FaPlus/>

        </button>



       </form>
    );
};

export default AddItem;
